import { ListItem, ListItemText } from '@material-ui/core'
import React from 'react'

const TodoList = ({id,todo,inprogress}) => {
    return (
        <div>
           <ListItem>
               <ListItemText primary={todo}
               secondary={ inprogress ? "In Progress" : "Completd"} />
           </ListItem>
        </div>
    )
}

export default TodoList
